import React from 'react';
import { Provider } from 'react-redux';
import store from './store';

import Products from './components/Products';
import Categories from './components/Categories';

function App() {
  return (
      <Provider store={store}>
          <div className='App'>
              <h1>Hello World</h1>
              <Categories />
              <Products />
          </div>
      </Provider>
  );
}

export default App;
